import { Dialog as BaseDialog, } from "@microsoft/fast-components-react-base";
import dialogSchema from "./dialog.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { DialogStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Dialog = manageJss(DialogStyles)(BaseDialog);
export { Dialog, dialogSchema, };
